import RowTableContact from "./components/RowTableContact";

const contacts = [
    { id: 1, name: 'Имя1 Фамилия ', email: "qwe1@gmail.com"},
    { id: 2, name: 'Имя2 Фамилия ', email: "qwe2@gmail.com"},
    { id: 3, name: 'Имя3 Фамилия ', email: "qwe3@gmail.com"},
    { id: 4, name: 'Имя4 Фамилия ', email: "qwe4@gmail.com"},
]

const TableContact = () => {
    return(
        <table className="table table-hover">
            <thead>
              <tr>
                <th>№</th>
                <th>Имя контактка</th>
                <th>E-mail</th>
              </tr>
            </thead>
            <tbody>
                <RowTableContact id={contacts[0].id}/>
                <RowTableContact />
                <RowTableContact />
            </tbody>
          </table>
    );
}

export default TableContact;
